import React from 'react';
import styled from 'styled-components';

const Todolistbox = styled.div`
  flex : 1;
  padding-top: 20px;
  padding-bottom: 50px;
  padding-right: 20px;
  padding-left: 20px;
  overflow-y: auto;
`;

function Todolist () {
  return <Todolistbox></Todolistbox>
}

export default Todolist;
